interface TableItemCellProps {
    children: any,
    isBig: boolean,
}

const TableItemCell: React.FC<TableItemCellProps> = ({
    children,
    isBig
}) => {

  const cl = 'notesTableCell' + (isBig ? ' bigItem' : '');

  return (
    <div className={cl}>
        {children}
    </div>
  );
}
  
  
export default TableItemCell;
